import React from 'react';
import './App.css';
import Home from './pages/Home';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Copyright from './components/Copyright';

class App extends React.Component {
 render () {
  return (
    <div>
      <Navbar />
      <Home />
      <Footer />
      <Copyright/>
    </div>
  );
}
}

export default App;
